        i0.ɵɵelementStart(592, "ol", 12);
        i0.ɵɵelementStart(593, "li");
        i0.ɵɵtext(594, " Out of all the consumption clients, only the DIKSHA web portal uses cookies. DIKSHA only uses session cookies, none of the other types of cookies. DIKSHA session cookies are used to store URLs in order to better redirect users to the right pages. For example, when a User signs-in to DIKSHA from the courses page, they'll need to be redirected back to the courses page at the end of sign-in for a cleaner user experience. Session cookies are also used to store whether to use the Content Delivery Network (CDN) to pull images, plugins and other assets that are shown on the user interface. This is to enable faster loading of the pages the User interacts with. No personal information, or user preferences are stored in cookies. ");
        i0.ɵɵelementEnd();
        i0.ɵɵelementStart(595, "li");
        i0.ɵɵtext(596, " Users can clear their cookies by going to their browser settings and clearing their browsing data (by specifically checking off the option to clear cookies). Doing so, does not impact their user experience on DIKSHA as usage of DIKSHA sets the cookies again. Users can also choose to block cookies from the settings as well. Doing so, will mean that certain things on DIKSHA will not function properly. For eg., images/plugins may take a long time to load and the user will not be taken to the right pages after login. ");
