        i0.ɵɵelementStart(667, "ol", 12);
        i0.ɵɵelementStart(668, "li");
        i0.ɵɵtext(669, " Content on the DIKSHA will be contributed by various content contributors across the country. The intent is to enable access to a wide range and diverse content from across the country so as to enable better contextualisation of content and wide access for end users. ");
        i0.ɵɵelementEnd();
        i0.ɵɵelementStart(670, "li");
        i0.ɵɵtext(671, " All content published on DIKSHA belongs to the creators of content be it individuals or organisations that have made content available on the platform, they are responsible for use by open learning platforms and applications therefore, content creators are responsibles for ensuring accuracy and appropriateness of content. ");
        i0.ɵɵelementEnd();
        i0.ɵɵelementStart(672, "li");
        i0.ɵɵtext(673, " Users can make multilingual and diverse content available on DIKSHA ranging from courses for in-service and pre-service teachers to classroom resources to tools for assessment and evaluation both of teachers and learners. ");
